import {
	VerticalTimeline,
	VerticalTimelineElement,
} from "react-vertical-timeline-component";
import "react-vertical-timeline-component/style.min.css";

const Timeline = () => {
	return (
		<VerticalTimeline layout={"2-columns"}>
			<VerticalTimelineElement
				className='vertical-timeline-element--work'
				contentStyle={{ background: "transparent", color: "#fff" }}
				contentArrowStyle={{ borderRight: "7px solid  #23ccfa" }}
				// date='2011 - present'
				iconStyle={{ background: "#23ccfa", color: "#fff" }}
				// icon={<WorkIcon />}
			>
				<h3 className='vertical-timeline-element-title'>Prelaunch</h3>
				{/* <h4 className='vertical-timeline-element-subtitle'>Miami, FL</h4> */}
				<p>
					⭕️ Daily Challenges to win a Free-Diadragon! <br />
					⭕️ 5-question-Fridays on Kahoot! Winner gets a Diadragon! <br />
					⭕️ Weekly townhalls <br />
					⭕️ Pre-launch merch! (whaaaat?! Learn more by inviting 10 friends!)
				</p>
			</VerticalTimelineElement>
			<VerticalTimelineElement
				className='vertical-timeline-element--work'
				// date='2010 - 2011'
				iconStyle={{ background: "transparent", color: "#fff" }}
				// icon={<WorkIcon />}
			>
				<h3 className='vertical-timeline-element-title'>
					Pre-Sale: October 27th
				</h3>
				{/* <h4 className='vertical-timeline-element-subtitle'>
					San Francisco, CA
				</h4> */}
				<p>
					⭕️ If you invite 10 friends and answer a question you will have
					access to our pre-launch! This is the best way to get a diadragon (or
					two) with low gas fees!
				</p>
			</VerticalTimelineElement>
			<VerticalTimelineElement
				className='vertical-timeline-element--work'
				// date='2008 - 2010'
				iconStyle={{ background: "transparent", color: "#fff" }}
				// icon={<WorkIcon />}
			>
				<h3 className='vertical-timeline-element-title'>
					Mint Day: October 30th
				</h3>
				{/* <h4 className='vertical-timeline-element-subtitle'>Los Angeles, CA</h4> */}
				{/* <p>User Experience, Visual Design</p> */}
			</VerticalTimelineElement>
			<VerticalTimelineElement
				className='vertical-timeline-element--work'
				// date='2006 - 2008'
				iconStyle={{ background: "#23ccfa", color: "#fff" }}
				// icon={<WorkIcon />}
			>
				<h3 className='vertical-timeline-element-title'>
					Reveal day: November 1st!{" "}
				</h3>
				{/* <h4 className='vertical-timeline-element-subtitle'>
					San Francisco, CA
				</h4> */}
				<p>
					⭕️ Will you get a rare diadragon???
					<br />
					⭕️ Got any games? Earn Your Wings Challenge Announcement
				</p>
			</VerticalTimelineElement>
			<VerticalTimelineElement
				className='vertical-timeline-element--education'
				// date='April 2013'
				iconStyle={{ background: "#23ccfa", color: "#fff" }}
				// icon={<SchoolIcon />}
			>
				<h3 className='vertical-timeline-element-title'>
					Diabetes awareness month: November 2021
				</h3>
				{/* <h4 className='vertical-timeline-element-subtitle'>Online Course</h4> */}
				<p>
					⭕️ Make it rain Life Drops begin
					<br />
					⭕️ Twitter takeover Change your PFP to gain access to new diadragon
					banners, memes, and animations. Art contests, theme song contest
					<br />
					⭕️ Ready for our close up Diadragons hits the press
					<br />
					⭕️ Health Focused Weekly Giveaways Nutrisense, Levels, Cooking
					Lessons, Personal Trainers, Scuba Certification, Castle Tour Vacation,
					and more!
				</p>
			</VerticalTimelineElement>
			<VerticalTimelineElement
				className='vertical-timeline-element--education'
				// date='November 2012'
				iconStyle={{ background: "#23ccfa", color: "#fff" }}
				// icon={<SchoolIcon />}
			>
				<h3 className='vertical-timeline-element-title'>December</h3>
				{/* <h4 className='vertical-timeline-element-subtitle'>Certification</h4> */}
				<p>
					⭕️ Merch for Diadragon Holders
					<br />
					⭕️ Diadragons Cookbook: Metabolic Health Noms{" "}
				</p>
			</VerticalTimelineElement>
			<VerticalTimelineElement
				className='vertical-timeline-element--education'
				// date='2002 - 2006'
				iconStyle={{ background: "#23ccfa", color: "#fff" }}
				// icon={<SchoolIcon />}
			>
				<h3 className='vertical-timeline-element-title'>Q1-2022</h3>
				{/* <h4 className='vertical-timeline-element-subtitle'>Bachelor Degree</h4> */}
				<p>
					⭕️ Product development for awareness (interactive merch!)
					<br />
					⭕️ I want to bulid a DAO with the initiative of filling the gaps in
					medical expenses and laws that are not currently filled by non-profits
					and insurance companies. Some people are not supported due to
					government restrictions. Let’s decide together who needs our help and
					what we can do about it{" "}
				</p>
			</VerticalTimelineElement>
		</VerticalTimeline>
	);
};
export default Timeline;
